const c = document.getElementById("M_Canvas");
var height = c.height;
const ctx = c.getContext("2d");

function draw_node(ctx, u) {
    ctx.beginPath();
    ctx.strokeStyle = 'black'
    ctx.fillStyle = 'white'
    ctx.lineWidth = 1;
    ctx.arc(10 + u * 16, height / 2, 5, 0, Math.PI * 2, true);
    ctx.fill();
    ctx.stroke();
}

function draw_edge(ctx, u, v, w) {
    ctx.beginPath();
    ctx.strokeStyle = 'black'
    ctx.lineWidth = w;
    ctx.arc(10 + (u + (v - u) / 2) * 16, height / 2, (v - u) * 8, 0, Math.PI, false);
    ctx.stroke();
}

function draw_back_edge(ctx, u, v, w) {
    ctx.beginPath();
    ctx.strokeStyle = 'red'
    ctx.lineWidth = w;
    ctx.arc(10 + (v + (u - v) / 2) * 16, height / 2, (u - v) * 8, 0, Math.PI, true);
    ctx.stroke();
}

